import tensorflow as tf
import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
from tensorflow.keras.datasets import cifar10
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Dense, Flatten
from tensorflow.keras.initializers import RandomNormal, GlorotUniform, HeNormal, LecunNormal

cifar_df = cifar10.load_data()
cifar_df = pd.DataFrame(cifar_df)

cifar_df.head()

# Load CIFAR-10 dataset
(x_train, y_train), (x_test, y_test) = cifar10.load_data()

# Normalize pixel values to [0, 1]
x_train, x_test = x_train / 255.0, x_test / 255.0

# Flatten the labels
y_train, y_test = y_train.flatten(), y_test.flatten()

"""#Step 2: Build a Simple ANN Model with Different Initializers"""

def create_model(initializer, activation_func):

  model = Sequential(
      [Flatten(input_shape=(32,32,3)),
       Dense(128, activation = activation_func[0], kernel_initializer = initializer),
       Dense (54, activation = activation_func[1], kernel_initializer= initializer),
       Dense(27, activation = activation_func[2], kernel_initializer= initializer),
       Dense(10, activation= 'softmax')

       ]
  )

  model.compile(optimizer = 'adam', loss = 'sparse_categorical_crossentropy', metrics = ['accuracy'])
  return model

"""![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

#Step 3: Train the Model for Each Initializer Separately
"""

initializers = {
    'GlorotUniform': GlorotUniform(seed=42),
    'HeNormal': HeNormal(seed=42),
    'LecunNormal': LecunNormal(seed=42),
}

activation_func=['relu','tanh','sigmoid']

history_dict = {}

for name, initializer in initializers.items():
  print('Training with', name, 'initializer')
  model=create_model(initializer,activation_func)
  history = model.fit( x_train, y_train, validation_data=(x_test,y_test),epochs=30, verbose=1)
  history_dict[f'{name}'] = history.history

"""![image.png](data:image/png;base64,)"""

history_dict.keys()

"""# Task 4: Visualize results for each initializer separately

"""

import matplotlib.pyplot as plt

# Task 4: Visualize results for each initializer separately
for name, history in history_dict.items():
    # Create a new figure for each initializer
    plt.figure(figsize=(12, 5))

    # Plot training and validation accuracy
    plt.subplot(1, 2, 1)
    plt.plot(history['accuracy'], label='Training Accuracy')
    plt.plot(history['val_accuracy'], label='Validation Accuracy')  # Add validation accuracy
    plt.xlabel('Epochs')
    plt.ylabel('Accuracy')
    plt.title(f'{name} Initializer: Accuracy')
    plt.legend()

    # Plot training and validation loss
    plt.subplot(1, 2, 2)
    plt.plot(history['loss'], label='Training Loss')
    plt.plot(history['val_loss'], label='Validation Loss')  # Add validation loss
    plt.xlabel('Epochs')
    plt.ylabel('Loss')
    plt.title(f'{name} Initializer: Loss')
    plt.legend()

    plt.tight_layout()
    plt.show()  # Show the figure for the current initializer

